import React, { Component } from 'react';
// import "../css/components/voterDetails.css"
class VoterDetails extends React.Component{
    state={
        voterID:"DL/01/001/000000",
        name:"Suresh Kumar",
        age:25,
        gender:'M'
    }
    render(){
        return(
        <div className="voterDetailsMainDiv">
            <div className="voterDTopDiv">
                <span className='voterDTxt'>Voter Details</span>
            </div>
            <div className='voterDBottomDiv'>
                <div className="voterDBottomLeftDiv">
                    <span>Voter ID:</span>
                    <span>Name:</span>
                    <span>Age:</span>
                    <span>Gender:</span>
                </div>
                <div className='voterDBottomRightDiv'>
                    <span className='voterDDetails'>{this.state.voterID}</span>
                    <span className='voterDDetails'>{this.state.name}</span>
                    <span className='voterDDetails'>{this.state.age}</span>
                    <span className='voterDDetails'>{this.state.gender}</span>
                </div>
            </div>

        </div>
        )
    }
}

export default VoterDetails;
